class SubmissionManager:
    def __init__(self, system):
        self.system = system

    def update_submission_status(self, submission_id, status):
        submission = next((s for s in self.system.submissions if s.id == submission_id), None)
        if submission:
            submission.update_status(status)

    def run_validations(self, submission):
        return self.system.run_validations_for_submission(submission)

class DataValidator:
    def __init__(self, system):
        self.system = system

    def validate_ppopzip_code(self, code):
        return self.system.validate_ppopzip_code(code)

class DataAnalyst:
    def __init__(self, system):
        self.system = system

    def load_historical_data(self):
        return self.system.load_historical_data()

class userDataSubmitter:
    def __init__(self, system):
        self.system = system

    def submit_data(self, user_id, data):
        user = next((u for u in self.system.users if u.id == user_id), None)
        if user:
            submission = Submission(len(self.system.submissions) + 1, user_id, data)
            self.system.add_submission(submission)
            return submission.id
        return None

